    .align-center;
`;
const LogoContainer = styled.div`

`
const Logo = styled.img`
    height: 100px;
`;

const MenuContainer = styled.div`
    .flex;
    .justify-between;
    .align-center;
`

const Header = () => {
    return (
        <Container>
            <LogoContainer>
                <Logo src="/logo.png"  alt="Vilva Athiban P B, The JS Jockey" />
            </LogoContainer>
            <MenuContainer>

            </MenuContainer>
        </Container>
    )
}

export default Header;
